exports=async function(a,b){const{parseCatalog:c}=await require("transcode/parse_catalog"),d=`https://www.danmei.la/book/${a.idPrefix()}/${a}/`;return c(d,[/<div class="mulu">\s*<ul>(?<fragment>(?:\s*<li>\s*<a[^>]*>[^<]*<\/a>\s*<\/li>)*)/,/<a href="(?<url>[^"]+)"[^>]*>(?<name>[^<]+)</g],{clientOptions:{...(b&&b.clientOptions),encoding:"gbk"}})};